import React from 'react';
import Work from './workTime';
import NonWork from './NonWorkTime';
const Home = ()=>{
    return(
        <>
        <h1>Restrictions</h1>
        <div className='row m-0'>
            
            <div className='col-12 mt-4'>
                <button onClick={worktime} className='btn btn-primary float-left ml-5'>Work Time</button>
                <button onClick={nonworktime} className='btn btn-light float-left'>Non-Work Time</button>
            </div>
            <div className='col-12 mt-5'>
                    <Work/>
            </div>
        </div>
       
        </>
    )
}

export default Home
